import React from 'react'

export function Child1(props) {
    return (
        <>
            <h3>Function Component - First Child</h3> 
            <p>Child - Props data from Parent - {props.parentToChild}</p>           
        </>
    )
}

export function Child2(props) {
    const data = "Constant data";
    return (
        <>
            <h3>Function Component - Second Child</h3> 
            <button onClick={() => props.childToParent(data)} >Click to change the data ( From Child to Parent)</button>           
        </>
    )
}
